('user_mail_register_admin_created_subject', 's:98:"Администратор сайта !site создал для Вас учетную запись";'),
('user_mail_register_admin_created_body', 's:852:"!username,\r\n\r\nАдминистратор сайта !site создал для Вас учётную запись. Вы можете войти на сайт !login_uri используя следующие имя пользователя и пароль:\r\n\r\nимя пользователя: !username\r\nпароль: !password\r\n\r\nВы также можете войти на сайт, нажав на следующую ссылку или скопировав ее в адресную строку вашего браузера:\r\n\r\n!login_url\r\n\r\nЭто одноразовый вход и воспользоваться им можно лишь однажды. После входа на сайт вы будете перенаправлены на страницу !edit_uri, где можете сменить свой пароль.\r\n\r\n\r\n-- !site team";'),
('user_mail_register_no_approval_required_subject', 's:84:"Учетные данные пользователя !username на сайте !site";'),
('user_mail_register_no_approval_required_body', 's:789:"!username,\r\n\r\nБлагодарим Вас за регистрацию на сайте !site. Вы можете сейчас войти на !login_uri используя следующие учетные данные:\r\n\r\nимя пользователя: !username\r\nпароль: !password\r\n\r\nВы так же можете войти, нажав на следующую ссылку или скопировав её в адресную строку браузера:\r\n\r\n!login_url\r\n\r\nЭто одноразовый вход и воспользоваться им можно лишь однажды. После входа на сайт вы будете перенаправлены на страницу !edit_uri, где можете сменить свой пароль.\r\n\r\n\r\n-- !site team";'),
('user_mail_register_pending_approval_subject', 's:145:"Учетные данные пользователя !username на сайте !site (ожидают решения администратора)";'),
('user_mail_register_pending_approval_body', 's:273:"!username,\r\n\r\nThank you for registering at !site. Your application for an account is currently pending approval. Once it has been approved, you will receive another e-mail containing information about how to log in, set your password, and other details.\r\n\r\n\r\n--  !site team";'),
('user_mail_password_reset_subject', 's:55:"Восстановление аккаунта !username";'),
('user_mail_password_reset_body', 's:772:"!username,\r\n\r\nЗапрос на сброс вашего аккаунта сделан с сайта !site.\r\n\r\nВ данный момент вы можете войти в !uri_brief по клику на ссылку или скопировав адрес в адресную строку браузера:\r\n\r\n!login_url\r\n\r\nЭтот логин может быть использован лишь однажды. При неиспользовании, срок его действия истечет через сутки, и с учетной записью не произойдет никаких изменений.\r\n\r\nПосле входа, вы будете перенаправлены на !edit_uri , где вы сможете ввести новый пароль.";'),
('user_mail_status_activated_notify', 'i:1;'),
('user_mail_status_activated_subject', 's:115:"Детали учетной записи !username на сайте !site (пользователь одобрен).";'),
('user_mail_status_activated_body', 's:434:"!username,\r\n\r\nYour account at !site has been activated.\r\n\r\nYou may now log in by clicking on this link or copying and pasting it in your browser:\r\n\r\n!login_url\r\n\r\nThis is a one-time login, so it can be used only once.\r\n\r\nAfter logging in, you will be redirected to !edit_uri so you can change your password.\r\n\r\nOnce you have set your own password, you will be able to log in to !login_uri in the future using:\r\n\r\nusername: !username\r\n";'),
('user_mail_status_blocked_notify', 'i:0;'),
('user_mail_status_blocked_subject', 's:124:"Детали учётной записи !username на сайте !site (пользователь заблокирован)";'),
('user_mail_status_blocked_body', 's:98:"!username,\r\n\r\nВаша учётная запись на !site была заблокирована.";'),
